import React from "react";

const Pokemon = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12 text-center">
          <h1>Michael's PC</h1>
          <p>
            Honchkrow
          </p>
          <p>
            Kricketune
          </p>
        </div>
      </div>
    </div>
  );
};

export default Pokemon;
